script: |
  super -f text -I q8796.spq | sort > q8796.out

inputs:
  - name: q8796.spq
    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) WHERE NOT - 59 + - - ( + col1 ) + - 83 NOT BETWEEN + col2 * - 45 AND - col2 * - col1 + 21;
  - name: tab1

outputs:
  - name: q8796.out
    data: |
      51	14	96
      85	5	59
      91	47	68
